import React, { useState } from 'react';
import Header from '../components/Header.js';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Addservice = () => {
  const navigate = useNavigate();
  const [file, setFile] = useState(null);

  // Function to handle file selection
  const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    setFile(selectedFile);
  };

  // Function to handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!file) {
      alert('Please select a file');
      return;
    }

    try {
      const formData = new FormData();
      formData.append('file', file);

      // Replace 'YOUR_API_ENDPOINT' with the actual API endpoint where you want to send the file
      const response = await axios.post('YOUR_API_ENDPOINT', formData);

      // Handle the response as needed
      console.log('File upload response:', response.data);

      // Redirect or perform any other action after successful upload
      navigate('/success'); // Replace '/success' with the desired route
    } catch (error) {
      console.error('Error uploading file:', error);
      // Handle the error as needed
    }
  };

  return (
    <div>
      <Header />
      <h1>Add Service</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="file">Select File:</label>
          <input type="file" id="file" onChange={handleFileChange} />
        </div>
        <button type="submit">Upload File</button>
      </form>
    </div>
  );
};

export default Addservice;
